    const [Skills, SetSkills] = useState([]);
    const [TitleSkills, SetTitleSkills] = useState("");
    const [ContentSkills, SetContentSkills] = useState("");


    return (
        <section className={cx("warpper")}>
            <Input
                name="Title Skills"
                type="text"
                required={true}
                id="TitleSkills"
                onChange={(e) => {}}
            />
            <Input
                name="Content Skills"
                type="text"
                required={true}
                id="ContentSkills"
                onChange={(e) => {}}
            />
            <MoreSkills
                
                dataOnMore={SetSkills}
            />

        </section>
    );

}
 export default CreateSkills;
